import React, { Component } from "react";

import "../Mini.css";

//
class MiniMenu extends Component {
  render() {
    return (
      <div className="All-1">
        <h1>Hi</h1>
        <a href="/">click me</a>
        <a href="/Rain">click me</a>
        <a href="/Ghibli">click me</a>
        <a href="/Classical">click me</a>
      </div>
    );
  }
}

export default MiniMenu;
